import React from "react";
import "./Weather.css";

export default function Weather() {
  return (
    <div className="Weather">
      <h1>New York</h1>
      <ul>
        <li>Wednesday 06:00 </li>
        <li>Cloudy</li>
      </ul>
    </div>
  );
}
